  `location_switch` tinyint(1) DEFAULT '0' COMMENT '限定打卡位置',
  `WORKING` tinyint(4) DEFAULT '1' COMMENT '1:在職 2:離職 3:未到職 4:留職停薪',
  `USER_PWD` varchar(500) NOT NULL COMMENT '密碼',
  `tel` varchar(20) DEFAULT NULL COMMENT '綁定對應',
  `GROUP_leader` tinyint(1) DEFAULT '0' COMMENT '小組長(審核用權限)1:組長0:預設',
